public class Solution {
    public int[] fill(int[] input) {
        if (input == null || input.length < 2) return input;
        boolean isZero = true;
        for (int i : input) {
            if (i!= 0 && i!= 8) throw new IllegalArgumentException("Invalid value");
            if (i == 8) isZero = false;
        }
        if (isZero) return input;
        int start = -1, end = -1;
        for (int i = 0; i < input.length; ++i) {
            if (input[i] == 8) {
                if (start == -1) start = i;
                end = i;
            } else if (start!= -1) break;
        }
        if (end == -1) return input;
        for (int i = start; i <= end; ++i) input[i] = 0;
        int left = start > 0? start - 1 : 0;
        while (left >= 0 && input[left] == 0) --left;
        int right = end + 1 < input.length? end + 1 : input.length - 1;
        while (right < input.length && input[right] == 0) ++right;
        for (int i = left + 1; i < right; ++i) input[i] = 8;
        return input;
    }
}
